                   </label>
                   </form> 
            </div>
        <div style={{justifyContent:'center', alignItems:'center', backgroundColor:'red'}}> 
            <Button label="Bejelentkezés" primary="true" ></Button>
            <Button label="Regisztráció" primary="true"></Button>
        </div>
        </div>
    )
}

export default Login;
